  "instructions": "<p>Good experience hunt for knights level 50+ with good skills (80/80+). The loot isn't good and the loss can be up to -8k/h.</p>\n<p></p>\n<p>üêù<strong> Creatures</strong></p>\n<p>This guide covers only the surface of the The Hive. Here you will find:</p>\n<ul>\n  <li><strong>Swarmers</strong>. Really fast but don't do a lot of damage.</li>\n  <li><strong>Insectoid Workers</strong>. Don't damage a lot but are harder to kill than Swarmers.</li>\n  <li><strong>Crawlers</strong>. Really fast and about as strong as a Giant Spider.</li>\n  <li><strong>Waspoids</strong>. Similar to the other creatures and have a bad poisoning.</li>\n  <li><strong>Hive Pore</strong>. Invincible unless you have the proper quest. You can shut it down for a few minutes but you can't kill it. This creature spawns lesser swarmers, which are swarmers with less hp and attack. The problem is that they block the path all the time and break your defense, making you get much more damage.</li>\n</ul>\n<p>Most of the time it's not worth using antidote as you will get poisoned anyway, except when it's from Waspoids as their poison really hurts.</p>\n<p></p>\n<p>üíØ<strong> Experience</strong></p>\n<p>A knight level 80 can reach up to 100k/h here, 150k/h on green stamina. Higher levels (100~) with good skills can tank and kill the mobs faster and make more than that.</p>\n<p></p>\n<p>üí∞<strong> Loot</strong></p>\n<p>Bad loot. Most of the times the loot and creature products don't cover up the costs. You shouldn't hunt here if you are afraid of wasting.</p>\n<p></p>\n<p>üíÇ<strong> NPCs</strong></p>\n<p>The most important NPCs in the area are NPC <em>A Rock in a Hard Place</em>, which sells supplies and buys creature products which you loot while hunting here; and NPC <em>Oracle</em>, who gives you quests which you can complete while hunting here, for some easy extra experience and hive points that can be traded for rewards like outfits.</p>",
